const Text = ({ items }) => {
  const renderedItem = items.map((item, index) => {
    return (
      <div key={item.title}>
        <div
          className="content active"
          onClick={() => console.log("title cliked", index)}
        >
          {" "}
          <p>{item.content}</p>{" "}
        </div>
      </div>
    );
  });
  return <div>{renderedItem}</div>;
};

export default Text;
